INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("2030/12/17 14:59:59", 1, "あたしだって\nやるときはやるよ！", 0, 0.0, 0.0, 24001, 0.0, 24, 102601, 1, "2020/04/30 12:00:00", 10040, "リン");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("2030/12/17 14:59:59", 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, 0.0, 0.0, 24002, 0.0, 24, 102601, 1, "2020/04/30 12:00:00", 10040, "リン");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("2030/12/17 14:59:59", 1, "終わった終わった\n一人でもなんとか\nなるもんだね", 2, 0.0, 0.0, 24003, 0.0, 24, 102601, 1, "2020/04/30 12:00:00", 10040, "リン");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("2030/12/17 14:59:59", 2, "やったね！\nこれでようやく\nサボれるよ…", 3, 0.0, 0.0, 24004, 0.0, 24, 102601, 2, "2020/04/30 12:00:00", 10040, "リン");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("2030/12/17 14:59:59", 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 4, 0.0, 0.0, 24005, 0.0, 24, 102601, 1, "2020/04/30 12:00:00", 10040, "リン");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("2030/12/17 14:59:59", 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 5, 0.0, 0.0, 24006, 0.0, 24, 102601, 2, "2020/04/30 12:00:00", 10040, "リン");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("2030/12/17 14:59:59", 2, "あたしも意外と\nやるもんでしょ？", 6, 0.0, 0.0, 24007, 0.0, 24, 102601, 2, "2020/04/30 12:00:00", 10040, "リン");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("2030/12/17 14:59:59", 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 7, 0.0, 0.0, 24008, 0.0, 24, 102601, 4, "2020/04/30 12:00:00", 10040, "リン");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("2030/12/17 14:59:59", 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", 8, 0.0, 0.0, 24009, 0.0, 24, 102601, 4, "2020/04/30 12:00:00", 10040, "リン");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("2030/12/17 14:59:59", 4, "まじめに\nやったんだけどな…\n悔しいな～", 9, 0.0, 0.0, 24010, 0.0, 24, 102601, 4, "2020/04/30 12:00:00", 10040, "リン");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("2030/12/17 14:59:59", 4, "やられた…\nねずみって意外と\nてごわいね", 10, 0.0, 0.0, 24011, 0.0, 24, 102601, 4, "2020/04/30 12:00:00", 10040, "リン");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("2030/12/17 14:59:59", 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", 11, 0.0, 0.0, 24012, 0.0, 24, 102601, 4, "2020/04/30 12:00:00", 10040, "リン");
INSERT INTO `v1_baa2508233a7d46267e9a90d96da9069668a17968502087694c178f93e37acbb` VALUES ("2030/12/17 14:59:59", 1, "疲れた…\nけど、次こそは\n守り抜くよ…", 12, 0.0, 0.0, 24013, 1.81, 24, 102601, 4, "2020/04/30 12:00:00", 10040, "リン");
